import React from 'react';
import Grid from '@mui/material/Grid';
import ShortPodcastList from '../Components/shared/ShortPodcastList';
import ShortGenreList from '../Components/shared/ShortGenreList';
import { DARK_BROWN } from '../Components/shared/Constant';

const Dashboard = () => {
  return (
    <div style={{ backgroundColor: DARK_BROWN }}> 
      <Grid>
        <Grid item xs={12} sx={{ padding: '50px' }}>
          <ShortGenreList />
          <ShortPodcastList genreName="Business" />
          <ShortPodcastList genreName="Technology" />
          <ShortPodcastList genreName="Society & Culture" />
          <ShortPodcastList genreName="Professional" />
        </Grid>
      </Grid>
    </div>
  )
}

export default Dashboard;
